import React from "react";
import ReactDOM from "react-dom";
function App() {
  function add(a, b) {
    return a + b;
  }

  function sub(a, b) {
    return a - b;
  }

  function div(a, b) {
    let div = a / b;
    div = div.toFixed(2);
    return div;
  }

  function mul(a, b) {
    return a * b;
  }
  return (
    <>
      {" "}
      <ul>
        <h1> Sum of two numbers is {add(10, 30)}</h1>
        <h1> Sub of two numbers is {sub(40, 8)}</h1>
        <h1> Div of two numbers is {div(20, 3)}</h1>
        <h1> Multiplication sum of two numbers is {mul(10, 3)}</h1>
      </ul>
    </>
  );
}

export default App;
